import {TouchableOpacity, Text} from 'react-native';
import { StyleSheet } from "react-native-web"

import styles from './style';

export default function ButtonCadastrar(props) {
    const { tipo, value, id, onPress } = props;
    var img;

    switch (tipo) {
        case 1:
            img = require('../../../assets/medico.png')
            break;
        case 2:
            img = require('../../../assets/escola.png')
            break;
        case 3:
            img = require('../../../assets/mercado.png')
            break;
        case 4:
            img = require('../../../assets/cinema.png')
            break;
        default:
            break;
    }
    return(
        <TouchableOpacity style={{display: 'flex', flexDirection: 'row'}} onPress={() => onPress()}>
            <Image source={img} style={{height: 100, width: 100}}/>
            <Text style={styles.text}>{value}</Text>
        </TouchableOpacity>
    )
}
